window.bookSummaryJSON = "<p><b>With time, plan and build contingencies.</b></p> <p>Admiral Jack Romanoff and his ragtag crew had paid in blood for breathing room to repair their ship and resupply. With that done, they could track down the Poseidon Group conspirators and kick the Locusts out of the cluster. Their fortunes seemed to be on the rise.</p> <p><b>With enemies all around, seek to maneuver.</b></p> <p>Only after examining the intelligence gathered during the invasion, it became clear a fresh storm was brewing on the horizon, and his ancient battleship would be battered like never before. In a battle of titans, there were only the victors and the dead, so triumph they would, no matter the cost.</p> <p><b>When backed into a corner, always come out fighting.</b></p>"; 
